import React from 'react';
import Card from './Card.js'

const CardList = ({ transactions }) => {

	function getFormattedDate(date) {
	  var year = date.getFullYear();

	  var month = (1 + date.getMonth()).toString();
	  month = month.length > 1 ? month : '0' + month;

	  var day = date.getDate().toString();
	  day = day.length > 1 ? day : '0' + day;

	  return month + '/' + day + '/' + year;
	}

	return (
		<div>
			<div>
				<h3 className="fl w-20 pa1 tc">Date</h3> 
				<h3 className="fl w-20 pa1 tc">Vender</h3> 
				<h3 className="fl w-20 pa1 tc">Amount</h3> 
				<h3 className="fl w-20 pa1 tc">Status</h3> 
				<h3 className="fl w-20 pa1 tc">Category</h3>
			</div>
			<div>
			{
				transactions.map((data, i) => {
					return (
						<Card 
						key={i}
						id={transactions[i].id} 
						date = {transactions[i].date}
						vendor={transactions[i].vendor}
						amount={transactions[i].amount}
						status={transactions[i].status}
						category={transactions[i].category}
						/>
						);
				})
			}
			</div>
		</div>
		);
}

export default CardList;
